# ==== Load config t·ª´ SQLite ====
def ask_config():
    conn = sqlite3.connect(DB_PATH)
    c = conn.cursor()
    c.execute("SELECT token, prefix, whitelist FROM config WHERE id = 1")
    row = c.fetchone()
    if row:
        use = input("üîÅ D√πng l·∫°i config c≈©? (y/n): ").strip().lower()
        if use == "y":
            token, prefix, whitelist = row
            conn.close()
            return {
                "token": token,
                "prefix": prefix,
                "whitelist_uid": json.loads(whitelist)
            }
    token = input("üîë Token bot: ").strip()
    prefix = input("‚å®Ô∏è Prefix l·ªánh: ").strip()
    uids = input("üü¢ ID ng∆∞·ªùi d√πng ƒë∆∞·ª£c ph√©p (c√°ch nhau b·∫±ng d·∫•u ph·∫©y): ").strip()
    whitelist = [int(i.strip()) for i in uids.split(",") if i.strip().isdigit()]
    c.execute("DELETE FROM config WHERE id = 1")
    c.execute("INSERT INTO config (id, token, prefix, whitelist) VALUES (1, ?, ?, ?)",
              (token, prefix, json.dumps(whitelist)))
    conn.commit()
    conn.close()
    return {"token": token, "prefix": prefix, "whitelist_uid": whitelist}

# ==== Load danh s√°ch troll t·ª´ DB ====
def load_troll():
    conn = sqlite3.connect(DB_PATH)
    c = conn.cursor()
    c.execute("SELECT content FROM trolls")
    trolls = [row[0] for row in c.fetchall()]
    conn.close()
    return trolls

# ==== Bot start ====
def run_bot(cfg):
    intents = discord.Intents.all()
    bot = commands.Bot(command_prefix=cfg["prefix"], intents=intents)
    tree = bot.tree
    tasks = {"spam": {}, "chui": {}}
    def allowed(uid): return uid in cfg["whitelist_uid"]
    async def warn(inter):
        try: await inter.user.send("üö´ B·∫°n kh√¥ng c√≥ quy·ªÅn d√πng bot n√†y.")
        except: pass

    @tree.command(name="spam")
    async def spam(inter: discord.Interaction, text: str, times: str):
        if not allowed(inter.user.id): await inter.response.send_message("üö´ Kh√¥ng c√≥ quy·ªÅn!", ephemeral=True); return await warn(inter)
        await inter.response.send_message("‚úÖ B·∫Øt ƒë·∫ßu spam", ephemeral=True)
        async def do():
            i = 0
            while times == "‚àû" or i < int(times):
                await inter.channel.send(text)
                await asyncio.sleep(1)
                i += 1
        tasks["spam"][inter.user.id] = asyncio.create_task(do())

    @tree.command(name="chui")
    async def chui(inter: discord.Interaction, mention: str = "", times: str = "5"):
        if not allowed(inter.user.id): await inter.response.send_message("üö´ Kh√¥ng c√≥ quy·ªÅn!", ephemeral=True); return await warn(inter)
        lst = load_troll()
        await inter.response.send_message("ü§¨ B·∫Øt ƒë·∫ßu ch·ª≠i", ephemeral=True)
        async def do():
            i = 0
            while times == "‚àû" or i < int(times):
                msg = f"{mention} {lst[i % len(lst)]}".strip()
                await inter.channel.send(msg)
                await asyncio.sleep(1)
                i += 1
        tasks["chui"][inter.user.id] = asyncio.create_task(do())

    @tree.command(name="add_troll")
    async def add_troll(inter: discord.Interaction, content: str):
        if not allowed(inter.user.id): return await inter.response.send_message("‚ùå Kh√¥ng c√≥ quy·ªÅn!", ephemeral=True)
        conn = sqlite3.connect(DB_PATH)
        c = conn.cursor()
        c.execute("INSERT INTO trolls (content) VALUES (?)", (content,))
        conn.commit()
        conn.close()
        await inter.response.send_message("‚úÖ ƒê√£ th√™m c√¢u ch·ª≠i!", ephemeral=True)

    @tree.command(name="list_troll")
    async def list_troll(inter: discord.Interaction):
        if not allowed(inter.user.id): return await inter.response.send_message("‚ùå Kh√¥ng c√≥ quy·ªÅn!", ephemeral=True)
        lst = load_troll()
        msg = "\n".join([f"{i+1}. {t}" for i, t in enumerate(lst)])
        await inter.response.send_message("üìã Danh s√°ch c√¢u ch·ª≠i:\n" + msg, ephemeral=True)

    @bot.event
    async def on_ready():
        await tree.sync()
        print(Colorate.Horizontal(Colors.green_to_white, f"‚úÖ Bot ƒë√£ online: {bot.user}"))

    bot.run(cfg["token"])

